import React, {Component} from 'react';
import Proptypes, { func } from 'prop-types';
import {withStyles} from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import { create } from 'jss';
const styles=theme=> ({

     root: {
         width: '100%',
         marginTop: theme.spacing.unit *3,
         overflowX: 'auto',

     },

     table: {
         minWidth: 700, 
     },
});
let id=0;
function getJobs(JobTitle,Description,Salary) {
    id+=1
    return(id,JobTitle,Description,Salary);
}

const rows= [
    createData('JeddahSoft', Java, experience, 75000 ),
    createData('Avanza', ReactJS,midLevel,4000),
    createData('xyz',AngularJS,expert,10000)
];
function SimpleTable(props){
    const {classes} =props;

return (

    <Paper className={classes.root}>
    <Table className={classes.table}>
      <TableHead>
        <TableRow>
          <TableCell>Dessert (100g serving)</TableCell>
          <TableCell numeric>Calories</TableCell>
          <TableCell numeric>Fat (g)</TableCell>
          <TableCell numeric>Carbs (g)</TableCell>
          <TableCell numeric>Protein (g)</TableCell>
        </TableRow>
      </TableHead>
      <TableBody>
        {rows.map(row => {
          return (
            <TableRow key={row.id}>
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell numeric>{row.calories}</TableCell>
              <TableCell numeric>{row.fat}</TableCell>
              <TableCell numeric>{row.carbs}</TableCell>
              <TableCell numeric>{row.protein}</TableCell>
            </TableRow>
          );
        })}
      </TableBody>
    </Table>
  </Paper>
);
}

